import React from "react";
import "../style/header.css";

import Content from "./headerComponents/Content";
import Preview from "./headerComponents/Preview";
function Header() {
  return (
    <header>
      <Preview />
      <Content />
      <Choice />
    </header>
  );
}

export default Header;
